import React from "react";

const Collection = () => {
  const [gender, setGender] = React.useState();
  const handleChange = e => {
    const target = e.target;
    if (target.checked) {
      setGender(target.value);

    }
  };

  return (

      <div>
        <label>
          <input
            type="radio"
            value="yes"
            checked={gender == "yes"}
            onChange={handleChange}
          />
          <span>yes</span>
        </label>
        <label>
          <input
            type="radio"
            value="no"
            checked={gender == "no"}
            onChange={handleChange}
          />
          <span>no</span>
        </label>
        { console.log(gender)}
      </div>


  );
};

export default Collection;
